<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Archive</title>
    <style>
        /* General Reset */
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Arial', sans-serif;
            background-color: #121212;
            color: #e0e0e0;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            min-height: 100vh;
            margin: 0;
            padding: 20px;
            overflow: hidden; /* Prevent scroll caused by the animated background */
        }

        canvas {
            position: absolute;
            top: 0;
            left: 0;
            z-index: -1;
        }

        header {
            text-align: center;
            margin-bottom: 20px;
        }

        header h1 {
            font-size: 2.5rem;
            color: #e1b12c;
        }

        header p {
            font-size: 1.1rem;
            color: #aaaaaa;
            margin-top: 10px;
        }

        #searchContainer {
            margin: 20px 0;
            width: 100%;
            max-width: 600px;
        }

        #searchInput {
            width: 100%;
            padding: 10px 15px;
            border-radius: 25px;
            border: 1px solid #444;
            font-size: 1rem;
            background: #1f1f1f;
            color: #e0e0e0;
        }

        #searchInput:focus {
            outline: none;
            border-color: #e1b12c;
        }

        .container {
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
            gap: 20px;
            max-width: 1200px;
        }

        .card {
            background: #1f1f1f;
            border: 1px solid #333333;
            border-radius: 15px;
            width: 300px;
            text-align: center;
            overflow: hidden;
            transition: transform 0.3s ease, box-shadow 0.3s ease;
        }

        .card:hover {
            transform: scale(1.05);
            box-shadow: 0 10px 20px rgba(0, 0, 0, 0.5);
        }

        .card img {
            width: 100%;
            height: 200px;
            object-fit: cover;
        }

        .card-content {
            padding: 20px;
        }

        .card-content h3 {
            font-size: 1.3rem;
            margin-bottom: 10px;
            color: #e1b12c;
        }

        .card-content p {
            font-size: 1rem;
            color: #bbbbbb;
            margin-bottom: 20px;
        }

        .download-btn {
            display: inline-block;
            background: linear-gradient(90deg, #bd8a09, #d4a31e);
            color: #fff;
            text-decoration: none;
            padding: 10px 20px;
            border-radius: 50px;
            font-size: 1rem;
            transition: background 0.3s ease, transform 0.2s ease;
        }

        .download-btn:hover {
            background: linear-gradient(90deg, #d4a31e, #bd8a09);
            transform: translateY(-3px);
        }

        footer {
            margin-top: 40px;
            text-align: center;
            color: #666666;
            font-size: 0.9rem;
        }

        footer a {
            color: #e1b12c;
            text-decoration: none;
        }

        footer a:hover {
            text-decoration: underline;
        }
    </style>
</head>
<body>

<canvas id="particleCanvas"></canvas>

<header>
    <h1>Script Archive</h1>
    <p>Trusted & Secure</p>
</header>

<div id="searchContainer">
    <input
        type="text"
        id="searchInput"
        placeholder="Search by title..."
        oninput="filterCards()" />
</div>

<div class="container" id="cardContainer">
    <!-- Cards will be loaded dynamically from JSON -->
</div>

<footer>
    <p>&copy; 2024 Script Archive | Stored with &#x1F9E1; by <a href="https://discord.com/users/1169391686452007025/">arko2230</a></p>
